import './Header.css'

const Header = () => {
    return (
        <nav>
            <div className="nav-wrapper grey darken-4">
                <a href="!#" className="brand-logo center Header"><i class="material-icons tv"></i>THE MOVIES</a>
            </div>
        </nav>
    )
}

export { Header }
